/**
 * Determines whether every element of a sequence satisfy a condition.
 * if the sequence is empty; otherwise, false.
 * @template T
 * @param {!Iterable<T>} source
 * @param {function(T, number): boolean} comparer
 * @return {boolean}
 */
export declare function every<T>(source: Iterable<T>, comparer: (value: T, index: number) => boolean): boolean;
